 2023 Estimate (#) of Median Household Income in the geographic area. Median Household Income is the amount that divides household income (annual income for all household earners age 15+) into two equal groups in a geographic area; half of the population will have income higher than the median and half will have lower income. If the median falls in the upper income interval of $200,000+, it is represented by the value of $200,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSPCICY":{"type":"number","alias":"2023 Per Capita Income","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Per Capita Income in the geographic area. Per Capita Income is calculated by dividing Aggregate Income by the Total Population for the area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHMEDNWCY":{"type":"number","alias":"2023 Median Net Worth","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Median Net Worth in the geographic area. Net Worth represents a measure of a household's wealth and ability to withstand financial hardship; it is total household assets, such as property and investments, less any secured or unsecured debt, such as credit cards. Median Net Worth divides household net worth into two equal groups in the geographic area; half of the households will have net worth higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"ATRISKTOTPOPCY":{"type":"number","alias":"2023 Total Population","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Total Population in the geographic area. Total Population includes population living in households, on active duty in the Armed Forces, and living in group quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, college dorms, and military barracks. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"_5YEARINCREMENTSMEDAGECY":{"type":"number","alias":"2023 Median Age","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Median Age of the population in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"ATRISKTOTHHCY":{"type":"number","alias":"2023 Total Households","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Total Households in the geographic area. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence. A household may include related family members, unrelated people, a person living alone, or a group of unrelated people sharing a housing unit, such as partners or roommates. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHMEDDICY":{"type":"number","alias":"2023 Median Disposable Income","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Median Disposable Income in the geographic area. Disposable Income represents money after taxes and provides an estimate of a household's purchasing power. Four types of taxes are deducted: federal individual income taxes, state individual income taxes, FICA (Social Security) and federal retirement payroll taxes, and property taxes for owner-occupied housing. Median Disposable Income divides disposable income distribution into two equal groups; half the population has disposable income higher than the median, and half lower. If the median is $200,000+, it is represented by a value of $200,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSPOPGRWCYFY":{"type":"number","alias":"2023-2028 Growth Rate: Population","vintage":"2028","source":"Esri","units":null,"decimals":null,"definition":"Esri 2028 five-year forecast for Population: Compound Annual Growth Rate (CAGR). The Population CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total Population between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSHHGRWCYFY":{"type":"number","alias":"2023-2028 Growth Rate: Households","vintage":"2028","source":"Esri","units":null,"decimals":null,"definition":"Esri 2028 five-year forecast for Households: Compound Annual Growth Rate (CAGR). The Households CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in total Households between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSFAMGRWCYFY":{"type":"number","alias":"2023-2028 Growth Rate: Families","vintage":"2028","source":"Esri","units":null,"decimals":null,"definition":"Esri 2028 five-year forecast for Families: Compound Annual Growth Rate (CAGR). The Families CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of families between the years 2023 and 2028. A family consists of two or more people residing together that are related by birth, marriage, or adoption. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC0CY":{"type":"number","alias":"2023 HH Income <$15000","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of Households with Income <$15,000 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC15CY":{"type":"number","alias":"2023 HH Income $15000-24999","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of Households with Income $15,000-$24,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC25CY":{"type":"number","alias":"2023 HH Income $25000-34999","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of Households with Income $25,000-$34,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC35CY":{"type":"number","alias":"2023 HH Income $35000-49999","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of Households with Income $35,000-$44,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC50CY":{"type":"number","alias":"2023 HH Income $50000-74999","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of Households with Income $50,000-$74,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC75CY":{"type":"number","alias":"2023 HH Income $75000-99999","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of Households with Income $75,000-$99,999 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"POLICYHINC100CY":{"type":"number","alias":"2023 HH Income $100000-149999","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the number of Households with Income $100,000-$  (aggregate) amount spent, average amount spent per household, and Spending Potential Index (SPI) on <em>Travel: Average</em> in the geographic area. Includes expected spending on travel transportation costs; vacation clubs; lodging; and food, drink, and entertainment on trips. Esri’s Consumer Spending data provides information about the estimated spending by households for goods and services in an area. The aggregate value represents the total amount spent by all households. The average value represents the typical amount spent per household. The SPI compares average local expenditures to U.S. levels. The SPI value for the U.S. is 100. If, for example, the SPI value for a geographic area is 120 this implies that average spending by consumers in the geographic area is likely to be 20 percent more than the U.S. average. Sources: Esri and Bureau of Labor Statistics. See <a target='_blank' href='https://links.esri.com/demographics/consumer-spending'>Consumer Spending data</a> for more information."},"ENTERTAINMENTX9073A":{"type":"number","alias":"2023 Avg: Tickets to Theatre/Operas/Concerts","vintage":"2023","source":"Esri-U.S. BLS","units":null,"decimals":null,"definition":"Esri 2023 estimates of the total (aggregate) amount spent, average amount spent per household, and Spending Potential Index (SPI) on <em>Tickets to Theatre/Operas/Concerts: Average</em> in the geographic area. Esri’s Consumer Spending data provides information about the estimated spending by households for goods and services in an area. The aggregate value represents the total amount spent by all households. The average value represents the typical amount spent per household. The SPI compares average local expenditures to U.S. levels. The SPI value for the U.S. is 100. If, for example, the SPI value for a geographic area is 120 this implies that average spending by consumers in the geographic area is likely to be 20 percent more than the U.S. average. Sources: Esri and Bureau of Labor Statistics. S ower income. If the median falls in the upper income interval of $200,000+, it is represented by the value of $200,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSPCICY":{"id":"PCI_CY","fullName":"KeyUSFacts.PCI_CY","alias":"2023 Per Capita Income","fieldName":"KEYUSFACTSPCICY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSPCICY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Per Capita Income in the geographic area. Per Capita Income is calculated by dividing Aggregate Income by the Total Population for the area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.WEALTHMEDNWCY":{"id":"MEDNW_CY","fullName":"Wealth.MEDNW_CY","alias":"2023 Median Net Worth","fieldName":"WEALTHMEDNWCY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.WEALTHMEDNWCY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Median Net Worth in the geographic area. Net Worth represents a measure of a household's wealth and ability to withstand financial hardship; it is total household assets, such as property and investments, less any secured or unsecured debt, such as credit cards. Median Net Worth divides household net worth into two equal groups in the geographic area; half of the households will have net worth higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.ATRISKTOTPOPCY":{"id":"TOTPOP_CY","fullName":"AtRisk.TOTPOP_CY","alias":"2023 Total Population","fieldName":"ATRISKTOTPOPCY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ATRISKTOTPOPCY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Total Population in the geographic area. Total Population includes population living in households, on active duty in the Armed Forces, and living in group quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, college dorms, and military barracks. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator._5YEARINCREMENTSMEDAGECY":{"id":"MEDAGE_CY","fullName":"5yearincrements.MEDAGE_CY","alias":"2023 Median Age","fieldName":"_5YEARINCREMENTSMEDAGECY","precision":1,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator._5YEARINCREMENTSMEDAGECY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Median Age of the population in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.ATRISKTOTHHCY":{"id":"TOTHH_CY","fullName":"AtRisk.TOTHH_CY","alias":"2023 Total Households","fieldName":"ATRISKTOTHHCY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ATRISKTOTHHCY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Total Households in the geographic area. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence. A household may include related family members, unrelated people, a person living alone, or a group of unrelated people sharing a housing unit, such as partners or roommates. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.WEALTHMEDDICY":{"id":"MEDDI_CY","fullName":"Wealth.MEDDI_CY","alias":"2023 Median Disposable Income","fieldName":"WEALTHMEDDICY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.WEALTHMEDDICY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Median Disposable Income in the geographic area. Disposable Income represents money after taxes and provides an estimate of a household's purchasing power. Four types of taxes are deducted: federal individual income taxes, state individual income taxes, FICA (Social Security) and federal retirement payroll taxes, and property taxes for owner-occupied housing. Median Disposable Income divides disposable income distribution into two equal groups; half the population has disposable income higher than the median, and half lower. If the median is $200,000+, it is represented by a value of $200,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSPOPGRWCYFY":{"id":"POPGRWCYFY","fullName":"KeyUSFacts.POPGRWCYFY","alias":"2023-2028 Growth Rate: Population","fieldName":"KEYUSFACTSPOPGRWCYFY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSPOPGRWCYFY","type":"esriFieldTypeDouble","vintage":"2028","source":"Esri","definition":"Esri 2028 five-year forecast for Population: Compound Annual Growth Rate (CAGR). The Population CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total Population between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSHHGRWCYFY":{"id":"HHGRWCYFY","fullName":"KeyUSFacts.HHGRWCYFY","alias":"2023-2028 Growth Rate: Households","fieldName":"KEYUSFACTSHHGRWCYFY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSHHGRWCYFY","type":"esriFieldTypeDouble","vintage":"2028","source":"Esri","definition":"Esri 2028 five-year forecast for Households: Compound Annual Growth Rate (CAGR). The Households CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in total Households between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSFAMGRWCYFY":{"id":"FAMGRWCYFY","fullName":"KeyUSFacts.FAMGRWCYFY","alias":"2023-2028 Growth Rate: Families","fieldName":"KEYUSFACTSFAMGRWCYFY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KE
